// src/modules/sku/SkuSearchResults.js

import React from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import ModelsCard from '../models/ModelsCard';
import modelsData from '../models/models.json';
import './SkuSearch.css';

const SkuSearchResults = ({ onSelectModel }) => {
  const { sku } = useParams();
  const navigate = useNavigate();

  const model = modelsData.models.find(model => model.sku.toLowerCase() === sku.toLowerCase());

  const handleSelectModel = (model) => {
    onSelectModel(model);
    navigate(`/cross-reference/sku/${sku}/alternatives`);
  };

  if (!model) {
    return <div>No models found for SKU: {sku}</div>;
  }

  return (
    <div className="container-fluid mb-5">
      <div className="row">
        <h3>Search Results for SKU: {sku}</h3>
      </div>
      <div className="row d-flex flex-wrap p-2">
        <ModelsCard
          key={model.id}
          model={model}
          isActive={false}
          onSelect={() => handleSelectModel(model)}
        />
      </div>
    </div>
  );
};

export default SkuSearchResults;
